import "../../assets/style.css"
import Carousel  from "../../components/Carousel/index";

//Home page
function Home() {
    return (
        <div className="homeBackground">
            <h1>Welcome to me</h1>
            <div className="dinoGiphy"><iframe src="https://giphy.com/embed/iVqXV4vE4DDYk" allowFullScreen></iframe></div>
            <h2 className="myname">Felix Dunham</h2>
            <h2 className="brand">Photographer and Editor Extraordinaire</h2>
            <div className="text-position">
                <p className="text">
                    I love taking photos and videos and editing them to make really cool content.
                </p>
            </div>
        </div>
    )
}

export default Home
